import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import CssBaseline from '@material-ui/core/CssBaseline';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import InboxIcon from '@material-ui/icons/MoveToInbox';
import MailIcon from '@material-ui/icons/Mail';

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  drawerContainer: {
    overflow: 'auto',
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
  },
}));

export default function ClippedDrawer() {
  const classes = useStyles();

  return (
    <h1>Hello world SETTINGS
    Account
    Notifications
    Playback and performance
    Privacy
    Connected accounts
    Watch on TV
    Billing and payments
    Advanced settings
    Account
    Choose how you appear and what you see on YouTube
    Signed in as joanlouji.20it@licet.ac.in
    Your YouTube channel
    This is your public presence on YouTube. You need a channel to upload your own videos, comment on videos, or create playlists.
    Your channel
    Create a channel
    Your account
    You sign in to YouTube with your Google account
    Google account
    View or change your Google account settings
    Your will be redirected to your Google account page
    Membership
    No membership | Get YouTube Premium
    YouTube Premium offers uninterrupted music, ad-free videos, and more</h1>
  );
}
